import React, { Component } from 'react';
import ReactDOM from 'react-dom';


class Menu extends Component {

    render() {
        return (
            <div className='menubar'>
                <ul className='menu'>
                    <li><a href='#'>Home</a> </li>
                    <li><a href='#'>FAQ</a> </li>
                    <li><a href='#'>Locais</a> </li>
                    <li><a href='#'>Categorias</a> </li>
                </ul>
            </div>
        )
    };
}

export default Menu;
